import React, { Component } from "react";
import './Login.css';
import {Button, Container, Form} from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

class Login extends Component {
  render() {
    return (
        <div>
          <section id="nav-bar">
          <nav class="navbar navbar-expand-lg bg-light">
  <div class="container-fluid">
    <a class="navbar-brand" href="https://www.geeksforgeeks.org/how-to-create-a-multi-page-website-using-react-js/">Navbar</a>
    <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse" id="navbarNav">
      <ul class="navbar-nav">
        <li class="nav-item">
          <a class="nav-link active" aria-current="page" href="#">Home</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="https://www.geeksforgeeks.org/how-to-create-a-multi-page-website-using-react-js/">Features</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="https://www.geeksforgeeks.org/how-to-create-a-multi-page-website-using-react-js/">Pricing</a>
        </li>
        <li class="nav-item">
          <a class="nav-link disabled">Disabled</a>
        </li>
      </ul>
    </div>
  </div>
</nav>
</section>

<section id="space">
<p></p>
</section>

<section id="card">
<div class="card">
  <div class="card-body">
  <h5 class="card-title">Body Temperature Cards Virtual Platform</h5>
    <p class="card-text">Welcome to our Hospital Virtual Platform. If you are not a Doctor of our Hospital, please exit. Any unauthorized access to the platform will be prosecuted.</p>
    <a href="https://www.bible.com/pl/" class="card-link">Exit</a>
  </div>
</div>
</section>
        </div>

    );
  }
}

export default Login;
